import { array } from 'one-core';
import { EC } from 'one-model';

export const ec = (
    value: any = {},
    context: any = {},
): EC => {
    const {
        Name,
        Relation,
        LegalGuardian,
        PhoneNumbers = [],
    } = value;

    const result: EC = {
        name: Name,
        relation: Relation,
        legalGuardian: LegalGuardian,
        phones: array(PhoneNumbers).map((p: any) => {
            const {
                Type,
                Number,
            } = p;
            return {
                num: Number,
                type: (
                    (Type) && (Type.toUpperCase())
                ),
            };
        }),
    };
    return result;
};
